import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';
import Navbar from './components/Navbar';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import AddExpense from './components/AddExpense';
import ExpenseList from './components/ExpenseList';
import Reports from './components/Reports';

// Sidebar Icons
const DashboardIcon = () => <i className="fas fa-th-large"></i>;
const TransactionsIcon = () => <i className="fas fa-exchange-alt"></i>;
const AccountsIcon = () => <i className="fas fa-wallet"></i>;
const ReportsIcon = () => <i className="fas fa-chart-line"></i>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Navbar />
          <div className="main-content">
            <Sidebar />
            <Routes>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route
                path="/"
                element={
                  <PrivateRoute>
                    <Dashboard />
                  </PrivateRoute>
                }
              />
              <Route
                path="/add-expense"
                element={
                  <PrivateRoute>
                    <AddExpense />
                  </PrivateRoute>
                }
              />
              <Route
                path="/expenses"
                element={
                  <PrivateRoute>
                    <ExpenseList />
                  </PrivateRoute>
                }
              />
              <Route
                path="/reports"
                element={
                  <PrivateRoute>
                    <Reports />
                  </PrivateRoute>
                }
              />
            </Routes>
          </div>
        </div>
      </Router>
    </AuthProvider>
  );
}

// Sidebar Component
function Sidebar() {
  return (
    <nav className="sidebar">
      <NavLink to="/" className={({isActive}) => isActive ? "sidebar-item active" : "sidebar-item"} end>
        <span className="sidebar-icon"><DashboardIcon /></span>
        <span className="sidebar-text">Dashboard</span>
      </NavLink>
      <NavLink to="/expenses" className={({isActive}) => isActive ? "sidebar-item active" : "sidebar-item"}>
        <span className="sidebar-icon"><TransactionsIcon /></span>
        <span className="sidebar-text">Transactions</span>
      </NavLink>
      <NavLink to="/accounts" className={({isActive}) => isActive ? "sidebar-item active" : "sidebar-item"}>
        <span className="sidebar-icon"><AccountsIcon /></span>
        <span className="sidebar-text">Accounts</span>
      </NavLink>
      <NavLink to="/reports" className={({isActive}) => isActive ? "sidebar-item active" : "sidebar-item"}>
        <span className="sidebar-icon"><ReportsIcon /></span>
        <span className="sidebar-text">Reports</span>
      </NavLink>
    </nav>
  );
}

export default App;
